@import "./functions";
@import "./mixins";
@import "./variable";
@import "../base/typography";

/*-------- EXTENDS = @EXTENDS --------
Los estilos creados serán inyectados en la regla SASS correspondiente, por ejemplo, con:
    h1 {
        @extend %fuente_h1;
    }
*/
%estructura_bloques {
    min-width: 100%;
    max-width: 100%;
    min-height: 100vh;
    display: flex;
    flex-direction: column;
    justify-content: center;
    align-items: center;
    padding: 6rem 0;
}

%bloque_texto {
    @include desktop_hd {
        width: 40vw;
    }
    
    @include desktop {
        width: 50vw;
    }
    
    @include tablet() {
        width: 65vw;
    }

    @include phone() {
        width: 80vw;
    }
}

%bloque_grilla {
    width: 80vw;
}

%fuente_h1 {
    font-size: $fuente_h1;
    font-weight: bold;
    text-align: center;
    margin-bottom: 1.5rem;
}

%fuente_h2 {
    font-size: $fuente_h2;
    font-weight: bold;
    text-align: center;
}

%fuente_h3 {
    font-size: $fuente_h3;
    font-weight: bold;
}

%fuente_p {
    font-size: $fuente_p;
    text-align: center;
}

%cambiar_alineacion {
    text-align: left;

    @include phone {
        text-align: center;
    }
}

%grilla_partners {
    @extend %bloque_grilla;
    display: flex;
    flex-wrap: wrap;
    justify-content: center;
    margin: 0 0 1rem 0;

    img {
        height: 5rem;
        width: 11rem;
    }
}

%link_grilla {
    a {
        color: $color_negro;
        text-decoration: none;
    }
}

%cambiar_ico {
    img {
        transition: opacity 1s ease;
    }

    img:nth-child(2) {
        opacity: 0;
        position: absolute;
    }

    &:hover {
        img:nth-child(2) {
            opacity : 1;
        }

        img:nth-child(1) {
            opacity : 0;
        } 
    }
}

%boton {
    cursor: pointer;
    border: none;
    border-radius: 300px;
    font-weight: bold;
    height: auto;
    padding: 0.375rem 0.75rem;
    font-size: $fuente_p;
}

%quotes {
    // font-family: $fuente_quote;
    min-width: $quote;
    height: $quote;
    background-color: $color_resaltado;
    font-size: $quote*2;
    text-align: right;
    margin: 4px 1rem 0 0;
}

